prompt --application/shared_components/security/authentications/iam
begin
wwv_flow_imp_shared.create_authentication(
 p_id=>wwv_flow_imp.id(51062717250610598)
,p_name=>'IAM'
,p_scheme_type=>'NATIVE_CUSTOM'
,p_attribute_01=>'fn_sentry_activar_cuenta'
,p_attribute_03=>'iam_authentication.login'
,p_attribute_05=>'N'
,p_plsql_code=>wwv_flow_string.join(wwv_flow_t_varchar2(
'function fn_sentry_activar_cuenta',
'  return boolean',
'is',
'  l_token       varchar2(1000);',
'  l_id_usuario  number;',
'  l_exists      number;',
'begin',
unistr('  -- P\00E1ginas p\00FAblicas \2192 acceso directo'),
'  if v(''APP_PAGE_ID'') in (''101'', ''9999'', ''99980'', ''99982'', ''99981'', ''100'', ''99984'') then',
'    return true;',
'  end if;',
'',
'  -- Extraer token',
'    l_token := regexp_substr(',
'      owa_util.get_cgi_env(''QUERY_STRING''),',
'      ''token=([^&]+)'',',
'      1, 1, null, 1',
'    );',
'  apex_debug.message(''Token recibido: '' || l_token);',
'',
'  if l_token is not null then',
'    -- Verificar existencia del token (solo por tipo)',
'    select count(*)',
'      into l_exists',
'      from inv_usuario_token',
'     where token = l_token',
'       and tipo_rc = ''ACTIVACION'';',
'',
'    apex_debug.message(''Token existe (ACTIVACION)? '' || l_exists);',
'',
'    if l_exists = 0 then',
unistr('      apex_debug.message(''Token NO existe \2192 redirigiendo a 101'');'),
'      apex_util.redirect_url(apex_page.get_url(p_page => 101));',
'      apex_application.stop_apex_engine;',
'    end if;',
'',
unistr('    -- Token existe, ahora validar expiraci\00F3n/uso'),
'    begin',
'      select id_usuario',
'        into l_id_usuario',
'        from inv_usuario_token',
'       where token = l_token',
'         and tipo_rc = ''ACTIVACION''',
'         and (usado is null or usado != ''S'')',
'         and (expiracion is null or expiracion > systimestamp);',
'',
unistr('      apex_debug.message(''Token v\00E1lido, activando cuenta para usuario ID = '' || l_id_usuario);'),
'',
'      inv_registro_pkg.fn_sentry_activar_cuenta(',
'        p_token      => l_token,',
'        p_id_usuario => l_id_usuario',
'      );',
'',
'      return true;',
'',
'    exception',
'      when no_data_found then',
unistr('        apex_debug.message(''Token expirado o usado \2192 redirigiendo a 99984'');'),
'        apex_util.redirect_url(apex_page.get_url(p_page => 99984));',
'        apex_application.stop_apex_engine;',
'    end;',
'',
'  else',
unistr('    -- Sin token: si logueado \2192 permitir, si no \2192 redirigir a login'),
'    if v(''APP_USER'') != ''nobody'' then',
unistr('      apex_debug.message(''Usuario logueado sin token \2192 permitir'');'),
'      return true;',
'    else',
unistr('      apex_debug.message(''Usuario an\00F3nimo sin token \2192 redirigir a 101'');'),
'      apex_util.redirect_url(apex_page.get_url(p_page => 101));',
'      apex_application.stop_apex_engine;',
'    end if;',
'  end if;',
'',
'  return false;',
'',
'exception',
'  when others then',
'    if sqlcode != -20876 then',
unistr('      apex_debug.error(''Excepci\00F3n inesperada: '' || sqlerrm);'),
'      apex_util.redirect_url(apex_page.get_url(p_page => 99984));',
'      apex_application.stop_apex_engine;',
'    end if;',
'    return false;',
'end;'))
,p_invalid_session_type=>'LOGIN'
,p_logout_url=>'f?p=&APP_ID.:101'
,p_post_auth_process=>'app_post_auth'
,p_use_secure_cookie_yn=>'N'
,p_ras_mode=>0
,p_version_scn=>41719165007487
);
end;
